id = "PAV069"
question = "Hur vill redaktionen bidra till att vetenskaperna tillämpas i praktiken?"
answer = "Hon bemöda sig om att tillämpa vetenskapen pâ mângfoldiga förhållanden inom naturen och det praktiska lifvet för att derigenom lifligare fästa de meddelade sanningarna i minnet och göra dem mera fruktbärände"
