id = "PAV072"
question = "Vad används stål till i vardagen?"
answer = "Stål finns i det mesta vi har runtomkring oss, bilar, strykjärn, mobiler, bestick och gatlampor. Produkter som inte innehåller stål är ofta plastprodukter som tillverkats i stålformar. Vårt samhälle är med andra ord helt beroende av stål"
